var app=angular.module("useful.filters",[]);app.filter("utFilter",function(){return function(a,f){if(f!==""&&!_.isUndefined(f)&&!_.isNull(f)){var e;if(f.tag){e=new RegExp("\\b"+f.text+"\\b","i");return _.filter(a,function(i){return _.some(i.tags,function(j){return j.search(e)>-1})})}else{if(f.podcastNumber){return _.filter(a,function(i){return i.podcastId===parseInt(f.text)})}else{e=new RegExp(f.text,"i");return _.filter(a,function(i){return d(i,e)||h(i,e)||c(i,e)||b(i)})}}}return a;function d(i,j){return g(i,j,"name")}function h(i,j){return g(i,j,"description")}function c(i,j){return _.some(i.tags,function(k){return k.search(j)>-1})}function b(i){return i.podcastId===parseInt(f.text)}function g(i,j,k){if(!_.isNull(i[k])){return i[k].search(j)>-1}return false}}});